import React, { Component } from 'react';
import Head from 'next/head';

// About Us Data
import AboutUs from '../../data/aboutus';

class AboutUsBlock extends Component {

    constructor(props) {
        super(props);
        this.state = {
            aboutBlock: ''
        }
    }
    componentDidMount() {
        this.setAboutBlock();
    }

    setAboutBlock=()=> {
        this.setState({aboutBlock: AboutUs.aboutBlock})
    }

    getAboutBlock=()=> {
        if(this.state.aboutBlock) {
            let address = this.state.aboutBlock.address.map((data, index)=> {
                return(
                    <div>
                        <h3>{data.heading}</h3>
                        <div className="info-holder">
                            <address>{data.address}</address>
                            <div className="img">
                                <img src={data.image} alt="Image Description" />
                            </div>
                        </div>
                    </div>
                )
            });
            return address;
            
        }
    }

    render() {
        return (
            <div>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" />
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <div className="address-blocks">
                    <div className="container">
                        {/* <h3>Aesthetic Record dallas, Tx Headquarters</h3>
                        <div className="info-holder">
                            <address>14555 Dallas Parkway Suite 100-369 Dallas, TX 75354</address>
                            <div className="img">
                                <img src="/img06.jpg" alt="Image Description" />
                            </div>
                        </div>
                        <h3> Aesthetic Record Columbus, oh office</h3>
                        <div className="info-holder">
                            <address>40 West Gay Street Columbus, OH 43215</address>
                            <div className="img">
                                <img src="/img07.jpg" alt="Image Description" />
                            </div>
                        </div> */}
                        {this.getAboutBlock()}
                        <div className="img-shape">
                            <img src="/icon-leaf-big.png" alt="Image Description" />
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default AboutUsBlock;
